import React from 'react';
import {Box, Spinner, Text} from "native-base";

const WRIndexLoadingIndicator = () => {
    return (
        <Box
            bg='#1C1C1E'
            flex={1}
            borderRadius='24px'
        >
            <Spinner color="emerald.500"/>
            <Text
                textAlign='center'
                mt='30px'
                whiteSpace='pre-line'
            >
                {'AI가 수면 데이터를 분석해서\n리포트를 만들고 있어요.'}
            </Text>
        </Box>
    );
};

export {WRIndexLoadingIndicator};
